    data: |
      SELECT DISTINCT - col2 * - col2 + col2 AS col1 FROM tab1 AS cor0 WHERE col1 / col1 * col0 NOT BETWEEN - ( - - 1 ) * 40 AND + - col1;
  - name: tab1

outputs:
  - name: q4076.out
    data: |
      3540
      4692
      9312
